// /src/components/PacjentList.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PacjentList = () => {
  const [pacjenci, setPacjenci] = useState([]);

  useEffect(() => {
    // Funkcja do pobrania danych z API
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8000/api/pacjenci/');
        setPacjenci(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    // Wywołanie funkcji pobierającej dane
    fetchData();
  }, []);

  return (
    <div>
      <h2>Lista Pacjentów</h2>
      <ul>
        {pacjenci.map(pacjent => (
          <li key={pacjent.id}>{pacjent.imie} {pacjent.nazwisko}</li>
        ))}
      </ul>
    </div>
  );
};

export default PacjentList;
